CREATE TABLE `emp_users` (
  `id` INT(11) NOT NULL AUTO_INCREMENT,
  `username` VARCHAR(192) COLLATE utf8_spanish_ci DEFAULT NULL,
  `password` VARCHAR(192) COLLATE utf8_spanish_ci DEFAULT NULL,
  `email` VARCHAR(450) COLLATE utf8_spanish_ci DEFAULT NULL,
  `is_active` TINYINT(1) DEFAULT NULL,
  `codigo_empleado_fk` INT(11) DEFAULT NULL,
  `roles` VARCHAR(750) COLLATE utf8_spanish_ci DEFAULT NULL,
  `nombre` VARCHAR(750) COLLATE utf8_spanish_ci DEFAULT NULL,
  `numero_identificacion` VARCHAR(60) COLLATE utf8_spanish_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=INNODB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;


