insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('1','1','CONTRATO INDIVIDUAL DE TRABAJO CUYA DURACIÓN ES POR LABOR CONTRATADA','Nombre Empleador: #4\r\nDirección Empleador: #6\r\nNombre Empleado: #2\r\nDocumento de Identidad: #1\r\nDirección Empleado: #5\r\nFecha Nacimiento: #8 \r\nNacionalidad: #b\r\nPeriodo de Pago: #e\r\nSalario Básico: #d \r\nLabor Contratada: #c\r\nLugar Donde Desempeñara Labores: #h\r\nFecha Inicio de Labores: #g\r\n\r\n\r\nEntre el EMPLEADOR y el TRABAJADOR, de las condiciones ya dichas, identificado como aparece al pie de sus firmas, se ha celebrado un contrato de Trabajo, regido además por las siguientes Cláusulas: PRIMERA: OBJETO. EL EMPLEADOR contratará los servicios personales del TRABAJADOR y éste se obliga: a) A poner al servicio del EMPLEADOR toda su capacidad normal de trabajo, en forma exclusiva en el desempeño de las funciones propias del oficio mencionado y en las labores anexas y complementarias del mismo, de conformidad con las órdenes e instrucciones que le imparta el EMPLEADOR directamente o a través de sus representantes, b) a no  prestar directa o indirectamente servicios laborales a otros EMPLEADORES, ni a trabajar por cuenta propia en el mismo oficio durante la vigencia de este contrato; y  c) A guardar absoluta reserva sobre los hechos, documentos, informaciones y en general, sobre todos los asuntos y materias que lleguen a su conocimiento por causa o con ocasión de su contrato.  SEGUNDA: REMUNERACIÓN. EL EMPLEADOR pagará al TRABAJADOR por la prestación de sus servicios el salario indicado, pagadero en las oportunidades también señaladas arriba. TERCERA: TRABAJO NOCTURNO, SUPLEMENTARIO, DOMINICAL Y/O FESTIVOS: Todo trabajo suplementario o en horas extras y todo trabajo en día domingo o festivo, en los que legalmente debe concederse descanso, se remunerará conforme a la Ley, así como los correspondientes recargos nocturnos. Para el reconocimiento y pago del trabajo suplementario, nocturno, dominical o festivo, el EMPLEADOR o sus representantes deberán haberlo autorizado previamente y por escrito de acuerdo con la programación mensual de turnos que se le entrega previamente.  Cuando la necesidad de este trabajo se presente de manera imprevista o inaplazable, deberá ejecutarse y darse cuenta de él por escrito, a la mayor brevedad, al EMPLEADOR o a sus representantes para su aprobación.  EL EMPLEADOR, en consecuencia, no reconocerá ningún trabajo suplementario, o trabajo nocturno o en días de descanso legalmente obligatorio que no haya sido autorizado previamente o que, habiendo sido avisado inmediatamente, no haya sido aprobado como se ha dicho.   CUARTA:   JORNADA DE TRABAJO: EL TRABAJADOR se obliga a trabajar la jornada máxima legal en los turnos y dentro de las horas señaladas por el EMPLEADOR, pudiendo hacer éste ajustes o cambios de horarios cuando lo estime conveniente. Por acuerdo expreso o tácito de las partes y por la naturaleza de la labor podrá ampliarse la jornada laboral sin que constituya trabajo suplementario o de horas extras conforme lo establece el artículo 165 del Código Sustantivo del Trabajo. QUINTA: PERÍODO DE PRUEBA: Los primeros dos meses del presente Contrato se consideran como período de prueba y, por consiguiente, cualquiera de las partes podrá terminarlo unilateralmente en cualquier momento durante dicho período, sin que se cause el pago de indemnización alguna. SEXTA: DURACIÓN DEL CONTRATO:   La duración del contrato será por labor contratada, que para el efecto señala como la duración del contrato celebrado entre EL CLIENTE y  EMPRESA LTDA, y por consiguiente la Terminación del contrato de Vigilancia, suscrito entre el EMPLEADOR y ese tercero, para cuya labor fue contratado el TRABAJADOR. Se entenderá como terminación de la labor contratada por cuanto desaparecen las causas que dieron origen al contrato y la materia del Trabajo. Así mismo, en caso de que EL CLIENTE solicite a empresa Ltda. El cambio del empleado por cualquier circunstancia, el presente contrato se entenderá terminado porque desaparece la causa que lo origino.   SEPTIMA:   TERMINACIÓN UNILATERAL: Son justas causas para dar por terminado unilateralmente este contrato por cualquiera de las partes, las enumeradas en los artículos 62 y 63 del Código Sustantivo del Trabajo, modificados por el Artículo Séptimo del Decreto 2351 de 1965.  EL TRABAJADOR podrá dar por terminado el presente contrato mediante aviso escrito al EMPLEADOR con antelación no inferior a treinta (30) días.  Además, son justas causas para dar por terminado unilateralmente este contrato, por parte del EMPLEADOR, las siguientes faltas que para el efecto  las partes  califican como graves: a) La violación por parte del TRABAJADOR, de cualquiera de sus obligaciones  legales contractuales o reglamentarias, b) La no asistencia puntual al trabajo por dos veces o más, dentro de un mismo mes calendario o negarse a prestar un turno, salvo casos de fuerza mayor debidamente comprobados por el EMPLEADOR o sus representantes, c) La ejecución por parte del TRABAJADOR de labores remuneradas al servicio de terceros sin autorización del EMPLEADOR, d) La revelación de secretos e información reservada de la empresa, del EMPLEADOR y del lugar donde desarrolle la labor, e) Las repetidas desavenencias con sus compañeros de trabajo,  f) La asistencia al trabajo en estado de embriaguez, alicoramiento o en estado no apto para ejercer sus funciones, g) El consumo de bebidas embriagantes en el sitio de trabajo, aún por primera vez, h)  La utilización y porte del uniforme, distintivo del servicio, placas o arma de dotación en oportunidades distintas al servicio y en lugares de expendio de licores, i) El abandono del sitio de trabajo sin la autorización del EMPLEADOR o de su representante,  j)La inasistencia a los turnos asignados o a parte del turno,  k) La solicitud de dádivas o prebendas de terceros para el desempeño de sus labores,   l) La ejecución de actos obscenos o inmorales dentro o fuera del sitio de trabajo y que afecte directa o indirectamente al EMPLEADOR o a sus representantes, m) La negativa a rendir los informes solicitados por el EMPLEADOR o dentro de los términos fijados n) El porte de armas o elementos de cualquier tipo, ajenos a los asignados por el EMPLEADOR para el desempeño de sus labores, o) El uso indebido dentro o fuera del servicio del arma de dotación, de la credencial, placas o distintivos que lo acreditan como vigilante al servicio del EMPLEADOR, p) Permitir la entrada o permanencia de personas extrañas en las dependencias puestas bajo su cuidado  o la salida de bienes y objetos de las mismas dependencias o del sitio de trabajo, q) Impedir o entorpecer la inspección o supervisión de los coordinadores o supervisores, representantes del EMPLEADOR en el lugar de trabajo, r) Quedarse dormido dentro de su servicio. OCTAVA: TERMINACIÓN UNILATERAL ESPECIAL. Son también justas causas para dar por terminado unilateralmente este contrato, sin lugar a indemnización las siguientes que se califican por las partes como faltas graves: a) La solicitud del CTI, DAS, POLICIA NACIONAL o EJERCITO NACIONAL o de cualquier otra autoridad, del retiro del TRABAJADOR, de la prestación del servicio, b)   La solicitud del usuario del cambio del trabajador por inconformidad en sus servicios c)La manipulación de equipos celulares, IPhones, Tablets o cualquier otro elemento electrónico que entorpezca la función del guarda de seguridad en su puesto de trabajo durante la jornada laboral. NOVENA: OBLIGACIONES ESPECIALES DEL TRABAJADOR: Son obligaciones contractuales y especiales del TRABAJADOR las siguientes: a)   Evitar fuera de las horas de trabajo actividades que afecten su salud e impidan la prestación eficiente del servicio, b) Manejar y cuidar con diligencia los bienes, elementos y armas encomendadas a su cuidado, c)   Conservar y restituir salvo el deterioro natural los elementos y objetos de dotación, d) Informar al EMPLEADOR toda circunstancia que sea de su interés o que tenga que ver con el desarrollo del objeto del servicio contratado, e) EL TRABAJADOR se obliga a devolver al EMPLEADOR al momento de la terminación de su contrato de trabajo el uniforme, la gorra, la placa, el arma de dotación y su salvoconducto, vehículos, municiones, y todos los elementos de dotación asignados para el ejercicio de su labor, f) Responder ante el EMPLEADOR, patrimonialmente por los perjuicios causados por la revelación de secretos, hechos o informaciones en general que lleguen a su conocimiento por causa o con ocasión de su contrato,     g) Responder al EMPLEADOR por la pérdida de elementos, bienes y objetos puestos bajo su cuidado y vigilancia, y que pertenezca al EMPLEADOR, como a terceras personas que hayan contratado los servicios del EMPLEADOR, h) Cumplir diligentemente las labores propias del cargo y realizar labores que directa o indirectamente tiendan a mejorar las condiciones de seguridad personal en los puestos de trabajo, según las instrucciones del EMPLEADOR. DÉCIMA: MODIFICACIONES DE LAS CONDICIONES LABORALES. EL TRABAJADOR acepta desde ahora expresamente todas las modificaciones determinadas por el EMPLEADOR,  en ejercicio de su poder subordinante de sus condiciones laborales, tales como la jordana de trabajo, el lugar de prestación de servicio y la forma de remuneración, siempre que tales modificaciones no afecten sus derechos mínimos, ni implique desmejoras sustanciales o graves perjuicios para él, de conformidad con lo dispuesto por el Artículo 23 del Código Sustantivo del Trabajo, modificado por el Artículo de la Ley 50 de 1990. DÉCIMA PRIMERA. DIRECCIÓN Y TELÉFONO DEL TRABAJADOR: EL TRABAJADOR se compromete a informar por escrito al EMPLEADOR cualquier cambio de dirección y teléfono fijo, teniéndose como suya la última dirección y teléfono registrados en la Empresa. DÉCIMA SEGUNDA. EFECTOS: El presente contrato reemplaza en su integridad y deja sin efecto cualquier otro contrato, verbal o escrito, celebrado entre las partes con anterioridad, pudiendo las partes convenir por escrito modificaciones al mismo, las que formará parte integral de este contrato.   Para constancia se firma en dos ejemplares del mismo tenor y valor, ante testigos en esta ciudad, el día #j, dejando constancia que se le hace entrega de la copia del presente contrato al trabajador.\r\n\r\n\r\n\r\n\r\n_______________________________________________\r\nEL EMPLEADOR\r\nNIT: #3 #p\r\n\r\n\r\n\r\n\r\n_______________________________________________\r\nEL TRABAJADOR\r\nC.C.: #1 de #i\r\n\r\n\r\n\r\n\r\n_______________________________________________\r\nTESTIGO\r\nC.C.:\r\n\r\n\r\n\r\n\r\n_______________________________________________\r\nTESTIGO\r\nC.C.:');
insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('2','2','CONTRATO INDIVIDUAL DE TRABAJO A TERMINO FIJO INFERIOR A UN AÑO','Entre los suscritos a saber, JGEFECTIVOS S.A.S Empresa De Servicios Temporales, empresa legalmente constituida en Agosto 3 del año 2011, registrada ante la cámara de comercio de Medellín, con matricula Mercantil No 21-453618-12, con identificación tributaria Nit 900.456.778- 3, autorizada mediante la Resolución N° 1578 de Ministerio de la Protección Social con fecha 13 de Diciembre de 2011 como Empresa de Servicios Temporales, representada en este contrato por su Gerente el señor representante legal, mayor de edad, vecino y domiciliado en la ciudad de Medellín, portador de la cédula de ciudadanía N° 70.00.00 exp en Medellin (Ant), y quien para efectos del presente contrato se denominara EL EMPLEADOR por una parte y por la otra parte.\r\n\r\nDocumento: #1\r\nNombre del Trabajador: #2\r\nDirección domicilio: #5\r\nBarrio: #7\r\nFecha de Nacimiento: #8\r\nMunicipio y Departamento Nacimiento: #9\r\nNacionalidad:  #b\r\nLabor Contratada: #c\r\nSalario: #d  \r\nForma de Pago: #e\r\nDías de pago: #f\r\nFecha de inicio: #g\r\nCiudad de Contratación: #h\r\nTérmino inicial del contrato:  #m meses\r\nFecha Vencimiento: #n\r\n\r\nEntre el empleador y el trabajador, de las condiciones ya dichas identificados como aparece al pie de sus correspondientes firmas se ha celebrado el presente contrato individual de  trabajo, regido además por las siguientes cláusulas:\r\nPRIMERA:- El empleador contrata los servicios personales del trabajador y este se obliga: a) A poner al servicio del empleador toda su capacidad normal de trabajo, en forma exclusiva en el desempeño de las funciones propias del oficio mencionado y las labores anexas y complementarias del mismo, de conformidad con las órdenes e instrucciones que le imparta el empleador o sus representantes, y b) A no prestar directa ni indirectamente servicios laborales a otros empleadores, ni a trabajar por cuenta propia en el mismo oficio, durante la vigencia de este contrato. También el trabajador tiene las siguientes obligaciones especiales: 1. Realizar personalmente la labor, en los términos estipulados; observar los preceptos del reglamento y acatar y cumplir las órdenes e instrucciones que de modo particular le impartan el empleador o sus representantes, según el orden jerárquico establecido. 2. No comunicar con terceros, salvo autorización expresa, las informaciones que tengan sobre su trabajo, especialmente sobre las cosas que sean de naturaleza reservada o cuya divulgación pueda ocasionar perjuicios al empleador, lo que no obsta para denunciar delitos comunes o violaciones del contrato o de las normas legales del trabajo ante las autoridades competentes. (Concordancia. Código Penal. Ley 0599 de 2000. Artículo 258. Utilización indebida de información privilegiada. Artículo 308. Violación de la reserva industrial o comercial). 3. Conservar y restituir en buen estado, salvo el deterioro natural, los instrumentos y útiles que le hayan sido facilitados y las materias primas sobrantes. 4. Guardar rigurosamente la moral en las relaciones con sus superiores y compañeros. 5. Comunicar oportunamente al empleador las observaciones que estime conducentes a evitarle daños y perjuicios. 6. Prestar la colaboración posible en casos de siniestro o de riesgo inminente que afecten o amenacen las personas o las cosas de la empresa o establecimiento. 7. Observar las medidas preventivas higiénicas, prescritas por el médico del empleador o por las autoridades del ramo. 8. Observar con suma diligencia y cuidado las instrucciones y órdenes preventivas de accidentes o de enfermedades profesionales. PARAGRAFO:- Prohibiciones al trabajadores. Se prohíbe al trabajador: 1. Sustraer de la fábrica, taller o establecimiento, los útiles de trabajo y las materias primas o productos elaborados, sin permiso del empleador.  2. Presentarse al trabajo en estado de embriaguez o bajo la influencia de narcóticos o drogas enervantes. Concordancia. Decreto 1108 de 1994 Por el cual se sistematizan, coordinan y reglamentan algunas disposiciones en relación con el porte y consumo de estupefacientes y sustancias sicotrópicas. Artículo 38. Prohibiciones a los empleados. Justa causa para dar por terminado el contrato de trabajo por parte del empleador. 3. Conservar armas de cualquier clase en el sitio del trabajo, a excepción de las que con autorización legal puedan llevar los celadores. 4. Faltar al trabajo sin justa causa de impedimento o sin permiso del empleador, excepto en los casos de huelga, en los cuales deben abandonar el lugar del trabajo. 5. Disminuir intencionalmente el ritmo de ejecución del trabajo, suspender labores, promover suspensiones intempestivas del trabajo o excitar a su declaración o mantenimiento, sea que se participe o no en ellas. 6. Hacer colectas, rifas y suscripciones o cualquier clase de propaganda en los lugares de trabajo. 7. Coartar la libertad para trabajar o no trabajar, o para afiliarse o no a un sindicato o permanecer en él o retirarse. 8. Usar los útiles o herramientas suministradas por el empleador en objetos distintos del trabajo contratado.\r\nSEGUNDA:- El empleador pagará al trabajador por la  prestación de sus servicios el salario indicado, pagadero en las oportunidades ya señaladas. Dentro de este pago se encuentra incluida la remuneración de los descansos dominicales y festivos de que tratan los capítulos I y II del título VII del Código Sustantivo del Trabajo. Se aclara y se conviene que en los casos en los que el trabajador devengue comisiones o cualquier otra modalidad de salario variable, el 82.5% de dichos ingresos, constituye remuneración ordinaria y el 17.5% restante esta designado a remunerar el descanso en los días dominicales y festivos que tratan los capítulos I y II del título VII del Código Sustantivo de Trabajo. \r\nTERCERA:- Todo trabajo suplementario o en horas extras y todo trabajo en día domingo  o festivo en los que legalmente debe concederse el descanso, se remunerará  conforme a la Ley, así como los correspondientes recargos nocturnos. Para el reconocimiento y pago del trabajo suplementario, dominical o festivo el empleador o sus representantes deben autorizarlo previamente por escrito. Cuando la necesidad de este trabajo se presente de manera imprevista o inaplazable, deberá ejecutarse y darse cuenta de él por escrito, a la mayor brevedad, al empleador o sus representantes. El empleador, en consecuencia, no reconocerá ningún trabajo suplementario o en días de descanso legalmente obligatorio que no haya sido autorizado previamente  o avisado inmediatamente, como queda dicho. \r\nCUARTA:- El trabajador se obliga a laborar la jornada ordinaria en los turnos y dentro de las horas señaladas por el empleador, pudiendo hacer éste ajustes o cambios de horario cuando lo estime conveniente. Por el acuerdo expreso o tácito de las partes, podrán repartirse las horas jornada ordinaria de la forma prevista en el artículo 164 del Código Sustantivo del Trabajo, modificado por el artículo 23 de la Ley 50 de 1990, teniendo en cuenta que los tiempos de descanso entre las secciones de la jornada no se computan dentro de la misma, según el artículo 167 ibídem. \r\nQUINTA:- Los primeros dos meses del presente contrato se consideran como período de prueba y, por consiguiente, cualquiera de las partes podrá dar por terminado el contrato unilateralmente, en cualquier momento de dicho periodo. Vencido éste, la duración del contrato será indefinida, mientras subsistan las causas que le dieron origen y la materia del trabajo; no obstante el trabajador podrá dar por terminado este contrato mediante aviso escrito al empleador con antelación no inferior a treinta días. En caso de no dar el trabajador el aviso, o darlo tardíamente, deberá al empleador una indemnización equivalente a un (1) salario mensual devengado por el trabajador. \r\nSEXTA:- Son justas causas para dar por terminado unilateralmente este contrato por cualquiera de las partes, las enumeradas en los artículos 62 y 63 del Código Sustantivo del Trabajo; y, además, por parte del empleado, las faltas que para el efecto se califiquen como graves en el espacio reservado para las cláusulas adicionales en el presente contrato. Es justa causa de terminación del contrato de trabajo por parte de la empresa, el ingresar menos de [N°] trabajadores en Misión. \r\nSEPTIMA:- Las invenciones o descubrimientos realizados por el trabajador contratado  para investigar pertenecen al empleador, de conformidad con el artículo 539 del Código de Comercio, así como el artículo 20 y concordantes de la ley 23 de 1982 sobre derechos de autor. En cualquier otro caso el invento pertenece al trabajador, salvo cuando éste no haya sido contratado para investigar y realice la invención mediante datos o medios conocidos o utilizados en razón de la labor desempeñada, evento en el cual el trabajador, tendrá derecho a una compensación que se fijará dé acuerdo con el monto del salario, la importancia del invento o descubrimiento, el beneficio que reporte al empleador u otros factores similares. \r\nOCTAVA:- Las partes podrán convenir  que el trabajo se preste en lugar distinto al inicialmente contratado, siempre que tales traslados no desmejoren las condiciones laborales o de remuneración del trabajador, o impliquen perjuicios para él. Los gastos que se originen con el traslado serán cubiertos por el empleador de conformidad con el numeral 8º del artículo 57 del Código Sustantivo del Trabajo. El trabajador se obliga a aceptar los cambios de oficio que decida el empleador dentro de su poder subordinante, siempre que se respeten las condiciones laborales del trabajador  y no se le causen perjuicios. Todo ello sin que se afecte el honor, la dignidad y los derechos mínimos del trabajador, de conformidad con el artículo 23 del Código Sustantivo del  Trabajo, modificado por el artículo 1º de la Ley 50 de 1990. \r\nNOVENA:- Entre las partes de común acuerdo pactan que no constituyen salario las sumas que ocasionalmente y por mera liberalidad recibe el trabajador del empleador, como primas, bonificaciones o gratificaciones ocasionales, participación de utilidades, y lo que recibe en dinero o en especie no para su beneficio, ni para enriquecer su patrimonio, sino para desempeñar a cabalidad sus funciones, como gastos de representación, medios de transporte, elementos de trabajo y otros semejantes, tampoco constituyen salario los beneficios o auxilios habituales u ocasionales acordados  contractualmente u otorgados en forma extralegal por el empleador, cuando las partes hayan dispuesto expresamente que no constituyen salario en dinero o en especie, tales como alimentación, habitación o vestuario, las primas extralegales, de vacaciones, de servicios o de Navidad.\r\nDECIMA:- Este contrato ha sido redactado estrictamente de acuerdo con la ley y la jurisprudencia y será interpretado de buena fe y en concordancia con el Código Sustantivo del Trabajo  cuyo objeto, definido en su artículo 1º, es lograr la justicia en las relaciones entre empleadores y trabajadores dentro de un espíritu de coordinación económica y equilibrio social. \r\nDECIMA PRIMERA:- El presente contrato reemplaza en su integridad y deja sin efecto alguno cualquiera otro contrato verbal o escrito celebrado por las partes con anterioridad. Las modificaciones que se acuerden al presente contrato se anotarán a continuación de su texto.\r\nPara constancia se firma en dos ejemplares del mismo tenor y valor, ante testigos en la ciudad de #r, el día #j.\r\n\r\n\r\n\r\n\r\n\r\nrepresentante legal\r\nC.C.: 70.854.409 de Támesis Antioquia\r\nRepresentante Legal\r\n#4\r\nNIT: #3 #p\r\n\r\n\r\n\r\n\r\n\r\n#2\r\nC.C.: #1 de #i');
insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('3','3','CONTRATO DE TRABAJO A TERMINO INDEFINIDO','Nombre Empleador: #4\r\nDirección Empleador: #6\r\nNombre Empleado: #2\r\nDocumento de Identidad: #1\r\nDirección Empleado: #5\r\nFecha Ingreso: #g\r\nCargo u oficio que desempeñara el trabajador: #c\r\nSalario: #d \r\nFecha Iniciación de labores: #g\r\nCiudad donde ha sido contratado el trabajador: #h\r\n\r\n\r\nEntre el Empleador y el Trabajador, de las condiciones ya dichas, identificados, como aparece al pie de sus firmas, se ha celebrado el presente Contrato Individual de Trabajo, regido además por las siguientes cláusulas: \r\n\r\n\r\nCLAUSULA PRIMERA:  \r\nOBJETO.  \r\nEl Empleador contrata los servicios personales del  Trabajador y éste se obliga: \r\n\r\na)  A poner al servicio del Empleador toda su capacidad normal de trabajo, en forma exclusiva en el desempeño de las funciones propias del oficio mencionado y en las labores anexas y complementadas del mismo, de conformidad  con las órdenes e instrucciones que le imparta El Empleador directamente o a través de sus representantes. \r\n\r\nb) A guardar absoluta reserva sobre los hechos, documentos, informaciones y en general, sobre todos los asuntos y materias que lleguen a su conocimiento por causa o con ocasión de su contrato de trabajo.\r\n\r\nParágrafo Primero: Hace parte integral del presente contrato las funciones detalladas en el manual de competencias del presente cargo.  \r\n\r\nParágrafo Segundo: La descripción anterior es general y no excluye ni limita para ejecutar labores conexas complementarias, asesorías o similares y en general aquellas que sean necesarias para un mejor resultado en la ejecución de la causa que dio origen al contrato. \r\n\r\n\r\nCLAUSULASEGUNDA: \r\nREMUNERACIÓN.  \r\nEl  Empleador  pagará  al Trabajador por la prestación de sus servicios el salario indicado, pagadero en las oportunidades mensualmente sin que ello signifique que unilateralmente el Empleador pueda pagar por períodos menores. \r\n\r\nParágrafo: El Trabajador autoriza al Empleador para que la retribución así como cualquier otro beneficio, sea prestacional, descanso vacaciones etc. originado en la existencia y/o terminación del contrato sean consignadas o trasladadas a cuenta que desde ya el Trabajador autoriza al Empleador para que sea abierta a su nombre en una institución financiera.\r\n\r\n\r\nCLAUSULA TERCERA:  \r\nTRABAJO NOCTURNO, SUPLEMENTARIO, DOMINICAL Y/O FESTIVO. \r\nPara el reconocimiento y pago del trabajo suplementario, nocturno, dominical o festivo, El Empleador o sus representantes deberán haberlo autorizado previamente y por escrito. Cuando la necesidad de este trabajo se presente de manera imprevista o inaplazable, deberá ejecutarse y darse cuenta de él por escrito, a la mayor brevedad, al Empleador o sus representantes para su aprobación. El Empleador, en consecuencia, no reconocerá ningún trabajo suplementario, o trabajo nocturno o en días de descanso legalmente obligatorio que no haya sido autorizado previamente o que, habiendo sido avisado inmediatamente, no haya sido aprobado como queda dicho. Tratándose de trabajadores de Dirección, confianza y Manejo, no habrá pago a horas Extras. El Empleador fijará las jornadas laborales de acuerdo a las necesidades del servicio pudiendo variarlas durante la ejecución del presente contrato. \r\n\r\n\r\nCLAUSULACUARTA: \r\nJORNADA DE TRABAJO. \r\nEl Trabajador  se obliga a laborar la jornada Tiempo Completo, equivalente a 48 horas semanales laboradas: De #k ; salvo estipulación expresa y escrita en contrario, en los turnos y dentro de las horas señalados por El Empleador,  pudiendo  hacer éste los ajustes o cambios de horario cuando lo estime conveniente. Por el acuerdo expreso o tácito de las partes, podrán repartirse las horas de la jornada ordinaria \r\n\r\n\r\nen la forma prevista en la ley, teniendo en cuenta que los tiempos de descanso entre las secciones de la jornada no se computan dentro de la misma. \r\n\r\nParágrafo: En desarrollo  del Objeto Social del Empleador, este podrá designar al Trabajador para que realice las funciones en las oficinas de los CLIENTES.\r\n\r\n\r\nCLAUSULAQUINTA: \r\nPERIODO DE PRUEBA.\r\nLos primeros dos meses del presente contrato se consideran como período de prueba y, por consiguiente, cualquiera de las partes podrá terminar el contrato unilateralmente, en cualquier momento durante dicho período, sin que se cause el pago de indemnización alguna. \r\n\r\n\r\nCLAUSULASEXTA: \r\nDURACIÓN DEL CONTRATO.\r\nLa duración del contrato será indefinida, mientras subsistan las causas que le dieron origen y la materia del trabajo. \r\n\r\n\r\nCLAUSULASEPTIMA: \r\nOBLIGACIONES DEL TRABAJADOR. \r\n\r\na. Las establecidas en la Ley Laboral, reglamento interno de trabajo y el cumplimiento de las instrucciones emitidas por el Empleador en transcurso del desarrollo del Contrato Laboral. \r\n\r\nb. Suscribir el acuerdo de Confidencialidad determinado por El Empleador.\r\n\r\nc. No ejercer actos de Competencia desleal frente al Empleador.\r\n\r\nd. Respetar los sitios de trabajo asignados por El Empleador, cumpliendo con las directrices de dichas Empresas. \r\n\r\ne. Tener una excelente presentación personal. \r\n\r\nd. Cumplir con los horarios estipulados por El Empleador para desarrollar las funciones con los CLIENTES. \r\n\r\nf. Demás obligaciones inherentes al presente Contrato Laboral.  \r\n\r\nCLAUSULA OCTAVA:\r\n\r\n\r\nTERMINACIÓN UNILATERAL.\r\nSon justas causas para dar por terminado unilateralmente este contrato, por cualquiera de las partes, las que establece la Ley, el reglamento interno, el presente contrato y/o las circulares que a lo largo de la ejecución del presente contrato establezcan conductas no previstas en virtud de hechos o tecnologías o cambios de actividad diferentes a las consideradas en el presente contrato. Se trata de reglamentaciones, ordenes instrucciones de carácter general o particular que surjan con posterioridad al presente acuerdo, cuya violación sea calificada como grave. Expresamente se califican en este acto como faltas graves la violación a las obligaciones y prohibiciones descritas y además las siguientes: \r\n\r\nA)	El incumplimiento de las normas y políticas que tenga la compañía para el uso de los sistemas, informática, software, claves de seguridad, materiales, computadores, útiles de oficina etc.,  que la Empresa entrega  al trabajador para la mejor ejecución de sus funciones. Así como violación a lo contenido en las normas de seguridad industrial.\r\n\r\nB)	La utilización para fines distintos a los considerados por el Empleador para el cumplimiento de su objeto social de las bases de datos de su propiedad. \r\n\r\nC)	Desatender las actividades de capacitación programadas por el Empleador así sea en horario diferente a la ordinaria. \r\nD)	La mala atención y desinterés para con los clientes y proveedores.\r\nE)	En caso de laborar en turnos, efectuar cambios sin la debida autorización del jefe inmediato. \r\nF)	Llegar tarde al sitio de trabajo. \r\nG)	No cumplir con las normas de seguridad industrial en los sitios de trabajo/ obras.\r\nH)	Negarse a cumplir con los protocolos  y procesos para la prestación de servicios encomendados, y demás establecidos por la Empresa en desarrollo de su objeto social. \r\nI)	Desatender las obligaciones antes mencionadas constituye justa causa para dar por terminado el contrato por parte del Empleador. \r\n\r\nViolar el acuerdo de confidencialidad determinado por la Empresa. \r\n\r\nCLAUSULA NOVENA: \r\nINVENCIONES.\r\nLas invenciones realizadas por El Trabajador le pertenecen a la Empresa siempre y cuando estas sean realizadas con ocasión y dentro de la ejecución del contrato de trabajo, y como parte del cumplimiento de las obligaciones del cargo. También \r\n\r\nlo son aquellas que se obtienen mediante los datos y medios conocidos o utilizados en razón de la labor desempeñada. \r\n\r\nCLAUSULADECIMA:  \r\nDERECHOS DE AUTOR.\r\nLos derechos patrimoniales sobre las obras, diseños invenciones, investigaciones  etc. creadas por el Trabajador en ejercicio  de sus funciones  o con ocasión ellas pertenecen al Empleador.\r\n\r\n\r\nCLAUSULAUNDECIMA:  \r\nTRASLADOS:\r\nDesde ya el Trabajador acuerda que el Empleador podrá trasladarlo desde el lugar, cargo y/o sitio de trabajo de acuerdo a las necesidades del servicio siempre y cuando no se menos cabe el honor, la dignidad o se produzca una desmejora sustancial o grave perjuicio con ocasión a la citada orden. El Empleador está obligado a asumir los gastos originados en el traslado. Siempre que sea una decisión unilateral de la Empresa.\r\n\r\n\r\nCLAUSULA DÉCIMA SEGUNDA:  \r\nBENEFICIOS EXTRALEGALES. \r\nEl  Empleador podrá reconocer beneficios, primas, prestaciones de naturaleza extra legal, lo que se hace a título de mera liberalidad y estos subsistirán hasta que el Empleador decida su modificación o supresión, atendiendo su capacidad, todos los cuales  se otorgan y reconocen, y el trabajador así lo acuerdan sin que tengan  carácter salarial y por lo tanto no tienen efecto prestacional o incidencia en la base  de aportes en la seguridad social o parafiscal en especial éste acuerdo se refiere a auxilios en dinero o en especie, primas periódicas o de antigüedad o en general beneficios de esa naturaleza los que podrán  ser modificados  o suprimidos  por el  Empleador de acuerdo con su determinación unilateral tal como fue otorgado. \r\n\r\n\r\nCLAUSULA DÉCIMA TERCERA: \r\nDESCUENTOS:\r\n\r\n\r\nEl Trabajador autoriza para que el Empleador descuente cualquier suma de dinero que se cause dentro de la existencia y terminación del contrato de trabajo ya sea por concepto de préstamos, alimentación a bajo costo,  bonos de alimentación, vivienda, utilización de medios de comunicación, aportes bienes dados a cargo y no reintegrados, u otros que se presenten en ejercicio de la labor que desarrolla.  Este descuento se podrá realizar de la nómina quincenal o mensual o  de las prestaciones sociales, indemnizaciones, descansos o cualquier beneficio que resulte con ocasión de la existencia o terminación del contrato por cualquier motivo. \r\n\r\n\r\nCLAUSULADECIMA CUARTA: \r\nMODIFICACIÓN DE LAS CONDICIONES LABORALES.  \r\nEl Trabajador acepta desde ahora expresamente todas las modificaciones determinadas por el Empleador, en lo referente  a sus condiciones laborales, tales como la jornada de trabajo, el lugar de prestación de servicio, el cargo u oficio y/o funciones y la forma de remuneración, siempre que tales modificaciones no afecten su honor, dignidad o sus derechos mínimos ni impliquen desmejoras sustanciales o graves perjuicios para él, de conformidad con lo dispuesto en la ley.\r\n\r\n\r\nCLAUSULA DÉCIMA QUINTA: \r\nDIRECCIÓN DEL TRABAJADOR.  \r\nEl Trabajador se compromete a informar por escrito al Empleador cualquier cambio de dirección teniéndose como suya, para todos los efectos, la última dirección registrada en la Empresa. \r\n\r\n\r\nCLAUSULADECIMA SEXTA: \r\nEFECTOS. \r\nEl presente contrato reemplaza en su integridad y deja sin efecto cualquiera otro contrato, verbal o escrito, celebrado entre las partes con anterioridad, pudiendo las partes convenir por escrito modificaciones al mismo, las que formarán parte integrante de éste contrato.\r\n\r\n\r\n\r\n\r\n_______________________________________________\r\nEL EMPLEADOR\r\nNIT: #3 #p\r\n\r\n\r\n\r\n_______________________________________________\r\nEL TRABAJADOR\r\nC.C.: #1 de #i\r\n\r\n\r\n\r\n_______________________________________________\r\nTESTIGO\r\nC.C.:');
insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('4','4','CONTRATO POR APRENDIZ DEL SENA','Entre los suscritos a saber, #4, empresa legalmente constituida en Agosto 3 del año 2011, registrada ante la cámara de comercio de la ciudad de Medellín, con matricula Mercantil N° 21-453618-12 con identificación tributaria  Nit 900.456.778-3, autorizada mediante la Resolución No 1578 de Ministerio de la Protección Social de fecha 13 de Diciembre de 2011 como Empresa de Servicios Temporales, representada legalmente por el señor representante legal, mayor de edad, vecino y domiciliado en la ciudad de Medellín, portador de la cédula de ciudadanía N° 70.00.00 exp en Medellin (Ant), y que para efectos del presente contrato se denominara como la EMPLEADORA  por una parte,  y por otra parte, #2 identificado (a) con cédula de ciudadanía número N° #1 expedida en #i, de Nacionalidad #b quien en adelante se llamará EL APRENDIZ, se ha celebrado el contrato de trabajo que se regirá bajo las siguientes cláusulas:\r\nPRIMERA: #4, es una empresa de servicios temporales debidamente constituida, dedicada a la prestación de servicios a terceros clientes, con el objeto de colaborar con ellos en el desarrollo de sus actividades ordinarias, inherentes, complementarias o conexas, mediante el envío de APRENDIZ en misión. En razón de ello, se firmó un contrato con la Empresa #4 quien requirió personal para ocupar el siguiente cargo:\r\n\r\nNombre del Cargo: #c\r\nHorario de Trabajo: #k\r\nDías de pago: #f\r\nInicio del Contrato: #g\r\n\r\n\r\nSEGUNDA: EL APRENDIZ declara conocer en forma clara y precisa el objeto y finalidad del contrato de trabajo que celebra #4, para dar cumplimiento a su objeto social, enunciado anteriormente y, por consiguiente, conoce y acepta expresamente que el contrato tenga vigencia o duración por tiempo que dura la prestación de los servicios temporales que dicha empresa contrata y para los cuales lo vincula.\r\nTERCERA: Terminada la labor o el tiempo por el cual #4, contrato los servicios temporales con el tercero, el contrato de trabajo suscrito para tal fin, llega a su término. \r\nCUARTA: EL APRENDIZ se obliga a prestar sus servicios personales a la usuaria del EMPLEADOR su normal capacidad de trabajo, en forma exclusiva en el desempeño de las funciones que se le encomienden y  de conformidad con los reglamentos, los cuales declara conocer y acatar y con las órdenes e instrucciones que le imparta EL EMPLEADOR o sus representantes o las personas o entidades ante quienes realice sus funciones por disposición de éste, todo lo cual forma parte integrante del presente contrato, para todos los efectos legales.\r\nQUINTA: Acuerdan las partes que el presente contrato tendrá duración o vigencia mientras subsistan las causas que le dieron origen a la materia del trabajo, todo esto en consonancia con las declaraciones preliminares que se hacen en este escrito sobre el objeto social de la usuaria y la forma de vinculación del APRENDIZ.\r\nSEXTA: El periodo de prueba corresponde a una Quinta parte del término de este contrato, sin que en ningún momento se exceda de dos meses,  durante este periodo podrá darse por terminado el contrato, unilateralmente, en cualquier momento.\r\nSÉPTIMA: Como remuneración el EMPLEADOR pagará al APRENDIZ la suma de #q, por mes calendario, la cual ambas partes convienen que sea pagada  #e, dentro del pago antes indicado está incluido el pago de los descansos en días dominicales y festivos de que tratan los capítulos I y II del título VII del Código Sustantivo del Trabajo. Así mismo se le cancelaran, los recargos de la ley por laborar horas extras, dominicales, festivos y trabajo nocturno, si los trabajase, con las autorizaciones de que se cuenta más adelante.\r\nOCTAVA: EL APRENDIZ Y LA EMPLEADORA, acuerdan expresamente que no constituyen salario los pagos o reconocimientos que se le hagan al primero por concepto de beneficios o auxilios habituales u ocasionales acordados convencional o contractualmente u otorgados en forma extralegal por la EMPLEADORA, tales como la alimentación, habitación o vestuario, las primas o bonificaciones extralegales de vacaciones, de servicio, de navidad, aguinaldos, auxilios o becas para estudio, auxilios por muerte de familiares o por calamidad doméstica, auxilios o reconocimientos por drogas o consultas médicas u odontológicas, o cualquier otro beneficio similar.\r\nNOVENA: EL APRENDIZ se obliga a desempeñar su misión en los turnos y dentro de las horas señaladas por la persona o entidad ante la cual realice sus funciones por orden de LA EMPLEADORA, pudiendo hacer éste ajustes o cambios de horario cuando así lo estime conveniente. Por el acuerdo expreso de las partes, podrán repartirse las horas de la jornada máxima legal en la forma prevista en el Articulo 23 de la ley 50 de 1990, teniendo en cuenta que los tiempos de descanso entre las secciones de la jornada de trabajo, no se computarán dentro de la misma, según el Artículo 167 del Código Sustantivo de trabajo. \r\nDÉCIMA: Todo trabajo suplementario o de horas extras, y todo trabajo en día domingo o festivo en los que legalmente debe concederse descanso, debe autorizarlo el LA EMPLEADORA o sus representantes o las personas o entidades ante quienes desempeña su misión por disposición de éste, previamente por escrito. En consecuencia no se reconocerá ningún trabajo suplementario o en días de descanso legalmente obligatorio que no haya sido autorizado previamente, como queda dicho.\r\nDÉCIMA PRIMERA: Son justas causas para poner término a este contrato, unilateralmente las enumeradas en el artículo 62 del Código Sustantivo de Trabajo, subrogado por el artículo 7 del Decreto 2351 de 1965 y, además por parte del EMPLEADOR, las siguientes faltas que para el efecto se califican como graves: a) La violación por parte del APRENDIZ, aun por la primera vez de cualquiera de sus obligaciones legales, contractuales o reglamentarias. b) Cualquier delito o contravención en que incurra el APRENDIZ  en perjuicio de los intereses de la EMPLEADORA  o contra su vida, honra y bienes, o contra sus representantes o compañeros de trabajo, sin perjuicio de las acciones penales respectivas. c) La ejecución por parte del APRENDIZ de las labores remuneradas al servicio de terceros. d) La revelación de cualquier acto reservado relacionado con los negocios de la EMPLEADORA. e) Las desavenencias con sus compañeros de trabajo que lleguen a crear dificultades para la buena marcha de la empresa a juicio de la EMPLEADORA. f) El hecho de que el APRENDIZ llegue embriagado o bajo el efecto de estupefacientes o drogas enervantes en el sitio de trabajo, o permanezca en ese estado en las instalaciones de la empresa, aun por la primera vez. g) La no asistencia a una sesión completa de la jornada de trabajo o más, sin excusa suficiente a juicio de la EMPLEADORA, por dos veces en un período de 30 días. h) El hecho de que el APRENDIZ abandone el sitio de trabajo sin el permiso de sus superiores, aún por la primera vez.\r\nDÉCIMA SEGUNDA: Las partes declaran que no reconocerán validez a estipulaciones anteriores a la fecha de este contrato, el cual tendrá vigencia a partir del #l.\r\nDÉCIMA TERCERA: EL APRENDIZ estará en misión en el cargo de #c con el cliente #4, entidad ésta con la cual LA EMPLEADORA contrata la prestación de los servicios laborales temporales que determinan la vinculación del APRENDIZ. \r\nDECIMA CUARTA- DERECHOS DEL APRENDIZ: El APRENDIZ en misión será afiliado al sistema de seguridad social integral (EPS, FONDO DE PENSION, ARP Y CAJA DE COMPENSACION FAMILIAR), a ser protegido en salud y en el trabajo a través del Coopaso, comité paritario de salud ocupacional de ambas empresas, a recibir el pago de sus prestaciones sociales y vacaciones, además se le notifica al APRENDIZ que la Empresa de Servicios Temporales #4. tiene una póliza de cumplimiento a favor de todos los APRENDIZes en misión que cubriría salarios y prestaciones sociales e indemnizaciones en caso de iliquidez de la empresa y conforme lo ordena el decreto 4369 de 2006. \r\n\r\nPara constancia se firma el presente contrato, en dos ejemplares de un mismo tenor, ante testigos el día #j.\r\n\r\n\r\n\r\n\r\nrepresentante legal\r\nC.C.:  70.854.409 de Támesis Antioquia\r\nRepresentante Legal\r\n#4\r\nNIT: #3 #p\r\n\r\n\r\n\r\n\r\n#2\r\nC.C.: #1 de #i\r\nAPRENDIZ en Misión');
insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('5','5','CONTRATO DE PRACTICA ESTUDIANTIL','Entre los suscritos a saber, #4, empresa legalmente constituida en Agosto 3 del año 2011, registrada ante la cámara de comercio de la ciudad de Medellín, con matricula Mercantil N° 21-453618-12 con identificación tributaria  Nit 900.456.778-3, autorizada mediante la Resolución No 1578 de Ministerio de la Protección Social de fecha 13 de Diciembre de 2011 como Empresa de Servicios Temporales, representada legalmente por el señor representante legal, mayor de edad, vecino y domiciliado en la ciudad de Medellín, portador de la cédula de ciudadanía N° 70.00.00 exp en Medellin (Ant), y que para efectos del presente contrato se denominara como la EMPLEADORA  por una parte,  y por otra parte, #2 identificado (a) con cédula de ciudadanía número N° #1 expedida en #i, de Nacionalidad #b quien en adelante se llamará EL PRACTICANTE, se ha celebrado el contrato de trabajo que se regirá bajo las siguientes cláusulas:\r\nPRIMERA: #4, es una empresa de servicios temporales debidamente constituida, dedicada a la prestación de servicios a terceros clientes, con el objeto de colaborar con ellos en el desarrollo de sus actividades ordinarias, inherentes, complementarias o conexas, mediante el envío de PRACTICANTE en misión. En razón de ello, se firmó un contrato con la Empresa #4 quien requirió personal para ocupar el siguiente cargo:\r\n\r\nNombre del Cargo: #c\r\nHorario de Trabajo: #k\r\nInicio del Contrato: #g\r\nDías de pago: #f\r\n\r\nSEGUNDA: EL PRACTICANTE declara conocer en forma clara y precisa el objeto y finalidad del contrato de trabajo que celebra #4, para dar cumplimiento a su objeto social, enunciado anteriormente y, por consiguiente, conoce y acepta expresamente que el contrato tenga vigencia o duración por tiempo que dura la prestación de los servicios temporales que dicha empresa contrata y para los cuales lo vincula.\r\nTERCERA: Terminada la labor o el tiempo por el cual #4, contrato los servicios temporales con el tercero, el contrato de trabajo suscrito para tal fin, llega a su término. \r\nCUARTA: EL PRACTICANTE se obliga a prestar sus servicios personales a la usuaria del EMPLEADOR su normal capacidad de trabajo, en forma exclusiva en el desempeño de las funciones que se le encomienden y  de conformidad con los reglamentos, los cuales declara conocer y acatar y con las órdenes e instrucciones que le imparta EL EMPLEADOR o sus representantes o las personas o entidades ante quienes realice sus funciones por disposición de éste, todo lo cual forma parte integrante del presente contrato, para todos los efectos legales.\r\nQUINTA: Acuerdan las partes que el presente contrato tendrá duración o vigencia mientras subsistan las causas que le dieron origen a la materia del trabajo, todo esto en consonancia con las declaraciones preliminares que se hacen en este escrito sobre el objeto social de la usuaria y la forma de vinculación del PRACTICANTE.\r\nSEXTA: El periodo de prueba corresponde a una Quinta parte del término de este contrato, sin que en ningún momento se exceda de dos meses,  durante este periodo podrá darse por terminado el contrato, unilateralmente, en cualquier momento.\r\nSÉPTIMA: Como remuneración el EMPLEADOR pagará al PRACTICANTE la suma de #q, por mes calendario, la cual ambas partes convienen que sea pagada  #e, dentro del pago antes indicado está incluido el pago de los descansos en días dominicales y festivos de que tratan los capítulos I y II del título VII del Código Sustantivo del Trabajo. Así mismo se le cancelaran, los recargos de la ley por laborar horas extras, dominicales, festivos y trabajo nocturno, si los trabajase, con las autorizaciones de que se cuenta más adelante.\r\nOCTAVA: EL PRACTICANTE Y LA EMPLEADORA, acuerdan expresamente que no constituyen salario los pagos o reconocimientos que se le hagan al primero por concepto de beneficios o auxilios habituales u ocasionales acordados convencional o contractualmente u otorgados en forma extralegal por la EMPLEADORA, tales como la alimentación, habitación o vestuario, las primas o bonificaciones extralegales de vacaciones, de servicio, de navidad, aguinaldos, auxilios o becas para estudio, auxilios por muerte de familiares o por calamidad doméstica, auxilios o reconocimientos por drogas o consultas médicas u odontológicas, o cualquier otro beneficio similar.\r\nNOVENA: EL PRACTICANTE se obliga a desempeñar su misión en los turnos y dentro de las horas señaladas por la persona o entidad ante la cual realice sus funciones por orden de LA EMPLEADORA, pudiendo hacer éste ajustes o cambios de horario cuando así lo estime conveniente. Por el acuerdo expreso de las partes, podrán repartirse las horas de la jornada máxima legal en la forma prevista en el Articulo 23 de la ley 50 de 1990, teniendo en cuenta que los tiempos de descanso entre las secciones de la jornada de trabajo, no se computarán dentro de la misma, según el Artículo 167 del Código Sustantivo de trabajo. \r\nDÉCIMA: Todo trabajo suplementario o de horas extras, y todo trabajo en día domingo o festivo en los que legalmente debe concederse descanso, debe autorizarlo el LA EMPLEADORA o sus representantes o las personas o entidades ante quienes desempeña su misión por disposición de éste, previamente por escrito. En consecuencia no se reconocerá ningún trabajo suplementario o en días de descanso legalmente obligatorio que no haya sido autorizado previamente, como queda dicho.\r\nDÉCIMA PRIMERA: Son justas causas para poner término a este contrato, unilateralmente las enumeradas en el artículo 62 del Código Sustantivo de Trabajo, subrogado por el artículo 7 del Decreto 2351 de 1965 y, además por parte del EMPLEADOR, las siguientes faltas que para el efecto se califican como graves: a) La violación por parte del PRACTICANTE, aun por la primera vez de cualquiera de sus obligaciones legales, contractuales o reglamentarias. b) Cualquier delito o contravención en que incurra el PRACTICANTE  en perjuicio de los intereses de la EMPLEADORA  o contra su vida, honra y bienes, o contra sus representantes o compañeros de trabajo, sin perjuicio de las acciones penales respectivas. c) La ejecución por parte del PRACTICANTE de las labores remuneradas al servicio de terceros. d) La revelación de cualquier acto reservado relacionado con los negocios de la EMPLEADORA. e) Las desavenencias con sus compañeros de trabajo que lleguen a crear dificultades para la buena marcha de la empresa a juicio de la EMPLEADORA. f) El hecho de que el PRACTICANTE llegue embriagado o bajo el efecto de estupefacientes o drogas enervantes en el sitio de trabajo, o permanezca en ese estado en las instalaciones de la empresa, aun por la primera vez. g) La no asistencia a una sesión completa de la jornada de trabajo o más, sin excusa suficiente a juicio de la EMPLEADORA, por dos veces en un período de 30 días. h) El hecho de que el PRACTICANTE abandone el sitio de trabajo sin el permiso de sus superiores, aún por la primera vez.\r\nDÉCIMA SEGUNDA: Las partes declaran que no reconocerán validez a estipulaciones anteriores a la fecha de este contrato, el cual tendrá vigencia a partir del #l.\r\nDÉCIMA TERCERA: EL PRACTICANTE estará en misión en el cargo de #c con el cliente #4, entidad ésta con la cual LA EMPLEADORA contrata la prestación de los servicios laborales temporales que determinan la vinculación del PRACTICANTE. \r\nDECIMA CUARTA- DERECHOS DEL PRACTICANTE: El PRACTICANTE en misión será afiliado al sistema de seguridad social integral (EPS, FONDO DE PENSION, ARP Y CAJA DE COMPENSACION FAMILIAR), a ser protegido en salud y en el trabajo a través del Coopaso, comité paritario de salud ocupacional de ambas empresas, a recibir el pago de sus prestaciones sociales y vacaciones, además se le notifica al PRACTICANTE que la Empresa de Servicios Temporales #4. tiene una póliza de cumplimiento a favor de todos los PRACTICANTEes en misión que cubriría salarios y prestaciones sociales e indemnizaciones en caso de iliquidez de la empresa y conforme lo ordena el decreto 4369 de 2006. \r\n\r\nPara constancia se firma el presente contrato, en dos ejemplares de un mismo tenor, ante testigos el día #j.\r\n\r\n\r\n\r\n\r\nrepresentante legal\r\nC.C.:  70.854.409 de Támesis Antioquia\r\nRepresentante Legal\r\n#4\r\nNIT: #3 #p\r\n\r\n\r\n\r\n\r\n#2\r\nC.C.: #1 de #i\r\nPRACTICANTE en Misión');
insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('6','6','SUSPENSIÓN DEL CONTRATO','Señor(a)																																																												\r\n#2 																																																												\r\nEMPLEADO 																																																												\r\nC.C.: #1 																																																												\r\nLa Ciudad																																																												\r\n 																																																												\r\nRegistro : SUSPENSIÓN DEL CONTRATO\r\n \r\nEl contrato de Trabajo suscrito entre usted y la Empresa de Servicios Temporales #5, y de acuerdo al Reglamento Interno de Trabajo, manual de Procedimientos, normas del Código Sustantivo Laboral y otros documentos que hacen parte de la relación laboral, dice que; el trabajador debe acatar las normas establecidas por la Empresa Temporal en todo lo relacionado a las normas anteriores. \r\nCon base en lo anterior se hace un SUSPENSION AL CONTRATO LABORAL con copia a la hoja de vida, la causal obedece a: #6, esta suspensión se hace efectiva durante el día #4 . \r\n\r\nLa reincidencia obedecerá a suspensión o dependiendo de la gravedad será motivo para la cancelación del contrato. \r\n\r\nRecuerde que usted debe aportar al logro de nuestro objeto social con sentido de pertenencia e interés común. \r\n\r\nEsperamos que esta situación no se siga presentando. \r\n \r\nAtentamente,\r\n \r\n \r\n\r\n___________________________________\r\nNOMBRE JEFE DE SELECCION O GESTION HUMANA\r\nJEFE DE GESTIÓN HUMANA - SELECCIÓN\r\n\r\n\r\n\r\n___________________________________\r\nRECIBIDO:      \r\nDOCUMENTO:');
