insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('10','10','CARTA LABORAL RETIRADO','.                                                                LA DIRECCIÓN DE RECURSOS HUMANOS\r\n\r\n\r\n                                                                                        HACE CONSTAR:\r\n\r\n\r\n\r\nQue la señor(a) #2 identificado(a) con cédula de ciudadanía N° #1, estuvo vinculado(a) a la empresa; desde el #4 hasta el #7, mediante un #8, en el cargo de #3.\r\n\r\n\r\nCualquier información adicional con gusto será suministrada en los teléfonos 4124586-4128506.\r\n\r\n\r\nSe expide en Medellín el día #a a solicitud del interesado. \r\n\r\n\r\n\r\nCordialmente,\r\n\r\n\r\n\r\n\r\nYULEY RUA PINEDA\r\nTalento Humano.');
