insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('12','12','REQUISITOS','\r\nYo, #1, identificado con el N° de identificación #2, declaro conocer todos los requisitos que se necesitan para legalizar la vinculación  como trabajador en misión de la EMPRESA #3; me comprometo que en un termino no mayor a quince (15) días calendario, haré llegar la documentación faltante para completar el proceso de ingreso. El incumplimiento a este compromiso, será causal para dar terminado el contrato suscrito entre las partes.\r\n\r\n\r\nAtentamente,\r\n\r\n\r\n\r\n\r\n\r\n');
insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('13',NULL,'CARTA TERMINACIÓN PUESTO','Señor\r\n#2\r\n#3\r\nCiudad\r\n\r\n\r\nAsunto: Terminación Contrato\r\n\r\nLa empresa le comunica que ha decidido cancelar el contrato de trabajo suscrito entre las partes a partir de la fecha en cumplimiento de la CLÁUSULA SEXTA del CONTRATO DE TRABAJO suscrito con usted y del cual posee copia, que en su numeral b) dice:\r\n\r\nSEXTA: DURACIÓN DEL CONTRATO. La duración del contrato será por labor contratada, que para el efecto señala como la duración del contrato celebrado entre la empleadora y EMPRESA LTDA, y por consiguiente la terminación del contrato de vigilancia, suscrito entre el EMPLEADOR y ese tercero, para cuya labor fue contratado el TRABAJADOR, se entenderá como terminación de la labor contratada por cuanto desaparecen las causas que dieron origen al contrato a la materia del trabajo. \r\n\r\nAgradecemos los servicios prestados  a la compañía durante  este tiempo y  le deseamos éxitos en las labores que emprenderá. \r\n\r\nFavor efectuar la entrega de todos los elementos  que le fueron suministrados  por la empresa con el fin de obtener el respectivo PAZ Y SALVO  para la cancelación de las prestaciones sociales a que tiene derecho por ley.\r\n\r\n\r\n\r\n\r\nCordialmente,\r\n\r\n\r\n\r\nYULEY RUA PINEDA\r\nTalento Humano');
insert into `gen_contenido_formato` (`codigo_contenido_formato_pk`, `numero_formato`, `titulo`, `contenido`) values('14',NULL,'CARTA TERMINACIÓN CAMBIO ADMINISTRADOR','Señor\r\n#2\r\n#3\r\nCiudad\r\n\r\n\r\nAsunto: Terminación Contrato \r\n\r\n\r\nLa empresa le comunica que ha decidido cancelar el contrato de trabajo suscrito entre las partes a partir de la fecha en cumplimiento de la CLÁUSULA OCTAVA del CONTRATO DE TRABAJO suscrito con usted y del cual posee copia, que en su numeral b) dice:\r\n\r\n\"OCTAVA: TERMINACIÓN UNILATERAL ESPECIAL: Son también justas causas para dar por terminado unilateralmente este contrato, sin lugar a indemnización las siguientes que se califican por las partes como faltas graves: b) La solicitud del usuario del cambio del trabajador por inconformidad en sus servicios.\"\r\n\r\nAgradecemos los servicios prestados  a la compañía durante  este tiempo y  le deseamos éxitos en las labores que emprenderá. \r\n\r\nFavor efectuar la entrega de todos los elementos  que le fueron suministrados  por la empresa con el fin de obtener el respectivo PAZ Y SALVO  para la cancelación de las prestaciones sociales a que tiene derecho por ley.\r\n\r\n\r\nCordialmente,\r\n\r\n\r\nYULEY  RUA PINEDA\r\nTalento Humano');
